                        "TEXT1": "Trekingové BBF \"Rimini Pro\" dámské 24rychl. nábojové dynamo",
                        "TEXT2": "Rám:µAlu Trapez\nVidlice:µodpružená Suntour NEX\nŘazení:µShimano Acera 24rychl.\nRáfky:µAlu dvoustěnné X6, Disc\nNáboj:µvpředu: Shimano nábojové dynamo, černé\n µvzadu: 24rychl.\nPláště:µKenda K935\n µčerné s reflexem\nBrzdy:µShimano Disc EF505, hydraulické\nOsvětlení:µvpředu: Büchel Uni Pro, 25 Lux\n µvzadu: Büchel Route 66\nCelková zátěž:µ120 kg\nHmotnost:µca. 17.2 kg\nBarva:µsvětle modrá matná",
                        "TEXT3": "Trekingové BBF \"Rimini Pro\" dámské 24rychl. nábojové dynamo",
                        "TEXT4": "28\", výška rámu 44 cm",
                        "TEXT5": "Tvar zaujme, technologie přesvědčí.\n<<>>\nSpolehlivé řazení s  Acera 24rychl. převodem od Shimano. Špičkové brzdění s hydraulickými kotoučovými brzdami Shimano.  Plná výbava dále zahrnuje nábojové dynamo, nosič zavazadel a systém LED osvětlení.",
