                        "ID_LANGUAGE": 2,
                        "NAME": "TR H BF7/Rimini Pro/Al/FGNDDi/Ac-24G/48blau-matt3",
                        "TEXT1": "Trekkingrad BBF \"Rimini Pro\" Herren 24-Gang ND",
                        "TEXT2": "Rahmen:µAlu Herren\nGabel:µFedergabel Suntour NEX\nSchaltung:µShimano Acera 24-Gang\nFelgen:µAlu Hohlkammer X6, Disc\nNaben:µvorn: Shimano Nabendynamo, schwarz\n µhinten: 24-Gang\nBereifung:µKenda K935\n µschwarz mit Reflex\nBremsen:µShimano Disc EF505, hydraulisch\nBeleuchtung:µvorn: Büchel Uni Pro, 25 Lux\n µhinten: Büchel Route 66\nzGG:µ120 kg\nGewicht:µca. 17.2 kg\nFarbe:µblau matt",
                        "TEXT3": "Trekkingrad BBF \"Rimini Pro\" Herren 24-Gang ND",
                        "TEXT4": "28\", RH 48 cm",
                        "TEXT5": "Die Form besticht, die Technik überzeugt.\n<<>>\nZuverlässiges Schalten mit der Acera 24-Gang Schaltung von Shimano. Punktgenaues Bremsen mit Shimanos hydraulischen Scheibenbremsen. Zur Vollaustattung gehören zudem Nabendynamo, Gepäckträger und LED-Lichtanlage.",
