                        "TEXT1": "Rower trekkingowy BBF \"Rimini Pro\" męski 24-biegowy dynamo w piaście",
                        "TEXT2": "Rama:µaluminium, męska\nWidelec:µamortyzowany, Suntour NEX\nBiegi:µShimano Acera 24-biegowy\nObręcze:µaluminium, wielokomorowe, X6, pod tarcze\nPiasty:µprzód: Shimano dynamopiasta, czarna\n µtył: 24-biegowa\nOgumienie:µKenda 935, czarne z odblaskiem\nHamulce:µShimano EF505, tarczowe, hydrauliczne\nOświetlenie:µprzód: Büchel Uni Pro, 25 ls\n µtył: Büchel Route 66\nDopuszczalna waga całkowita:µ120 kg\nWaga:µokoło 17,2 kg\nKolor:µniebieski mat",
                        "TEXT3": "Rower trekkingowy BBF \"Rimini Pro\" męski 24-biegowy dynamo w piaście",
                        "TEXT4": "28\", wys. ramy 48 cm",
                        "TEXT5": "Piękny kształt, przekonująca technologia.\n<<>>\nNiezawodna zmiana biegów dzięki 24-biegowej przekładni Shimano Acera. Precyzyjne hamowanie dzięki hydraulicznym hamulcom tarczowym Shimano. Pełnego wyposażenia dopinają: dynamo w piaście, bagażnik oraz system oświetlenia LED.",
