                        "NAME": "TR D BF8/TREVISO/AlT/FGNDDi/D-27G/45petrol-matt3",
                        "TEXT1": "Trekkingrad BBF \"Treviso\" Damen 27-Gang ND",
                        "TEXT2": "Rahmen:µAlu Trapez\nGabel:µFedergabel Suntour NEX\nSchaltung:µShimano Deore 27-Gang\nFelgen:µAlu Hohlkammer X6, Disc\nNaben:µvorn: Shimano Nabendynamo, schwarz\n µhinten: 27-Gang\nBereifung:µSchwalbe Road Cruiser\n µschwarz mit Reflex\nBremsen:µShimano Disc MT200, hydraulisch\nBeleuchtung:µvorn: AXA Compactline, 35 Lux\n µhinten: AXA Slim Steady\nzGG:µ120 kg\nGewicht:µca. 16.1 kg\nFarbe:µpetrol matt",
                        "TEXT3": "Trekkingrad BBF \"Treviso\" Damen 27-Gang ND",
                        "TEXT4": "28\", RH 45 cm",
                        "TEXT5": "Kompromisslos in Technik und Design.\n<<>>\nPräzises Schalten mit der Shimano Deore 27-Gang Schaltung. Beim sicheren Bremsen unterstützen Shimanos hydraulische Scheibenbremsen. Zur Vollausstattung gehören Nabendynamo, integrierter Gepäckträger und LED-Lichtanlage.",
