                        "TEXT2": "Rám:µAlu Trapez\nVidlice:µodpružená Suntour NEX\nŘazení:µShimano Deore 27rychl.\nRáfky:µAlu dvoustěnné X6, Disc\nNáboj:µvpředu: Shimano nábojové dynamo, černé\n µvzadu: 27rychl.\nPláště:µSchwalbe Road Cruiser\n µčerné s reflexem\nBrzdy:µShimano Disc MT200, hydraulické\nOsvětlení:µvpředu: AXA Compactline, 35 Lux\n µvzadu: AXA Slim Steady\nCelková zátěž:µ120 kg\nHmotnost:µca. 16.1 kg\nBarva:µpetrolová matná",
                        "TEXT3": "Trekingové BBF \"Treviso\" dámské 27rychl. nábojové dynamo",
                        "TEXT4": "28\", výška rámu 45 cm",
                        "TEXT5": "Nekompromisní v technologii a designu.\n<<>>\nPrecizní řazení s Shimano Deore 27rychl. převodem. Bezpečné brzdění s Shimano hydraulickými kotoučovými brzdami. K úplnému vybavení patří, nábojové dynamo, integrovaný nosič a osvětlení LED.",
