                        "TEXT1": "Rower trekkingowy BBF \"Treviso\" męski 27-biegowy dynamo w piaście",
                        "TEXT2": "Rama:µaluminium, męska\nWidelec:µamortyzowany, Suntour NEX\nBiegi:µShimano Deore 27-biegowy\nObręcze:µaluminium, wielokomorowe, X6, pod tarcze\nPiasty:µprzód: Shimano dynamopiasta, czarna\n µtył: 27-biegowa\nOgumienie:µSchwalbe Road Cruiser\n µczarne z odblaskiem\nHamulce:µShimano MT200 tarczowe, hydrauliczne\nOświetlenie:µprzód: AXA Compactline, 35 ls\n µtył: AXA Slim Steady\nDopuszczalna waga całkowita:µ120 kg\nWaga:µokoło 16,1 kg\nKolor:µpetrol mat",
                        "TEXT3": "Rower trekkingowy BBF \"Treviso\" męski 27-biegowy dynamo w piaście",
                        "TEXT4": "28\", wys. ramy 50 cm",
                        "TEXT5": "Bezkompromisowy w technologii i wzornictwie.\n<<>>\nPrecyzyjna zmiana biegów dzięki 27-biegowej przekładni Shimano Deore. Hydrauliczne hamulce tarczowe Shimano zapewniają bezpieczne hamowaanie. Pełnego wyposażenia dopełniają: dynamo w piaście, zintegrowany bagażnik oraz system oświetlenia LED.",
