                        "TEXT5": "Bezkompromistní v technice a designu.\n<<>>\nPrecizní řazení s Deore 27rychl. řazením od Shimano. Bezpečné brzdění s Shimano hydraulickými kotoučovými brzdami. K úplnému vybavení patří nábojové dynamo, integrovaný nosič a osvětlení LED.",
