                        "ID_LANGUAGE": 2,
                        "NAME": "TR D BF9/Bilbao Gates/AlT/NDDi/N8LL-Di/45sw-matt3 Gates Riemen",
                        "TEXT1": "Trekkingrad BBF \"Bilbao Gates\" Damen 8-Gang ND",
                        "TEXT2": "Rahmen:µAlu Trapez\nGabel:µAlu Starrgabel, Urbanstyle\nSchaltung:µShimano Nexus 8-Gang, FL\nAntrieb:µGates Riemenantrieb\nFelgen:µAlu Hohlkammer X15\nNaben:µvorn: Shimano Nabendynamo, schwarz\n µhinten: 8-Gang, Freilauf\nBereifung:µContinental Speed Ride, schwarz\n µmit Reflex\nBremsen:µShimano Disc MT201, hydraulisch\nBeleuchtung:µvorn: AXA Compactline, 35 Lux\n µhinten: AXA BlueLine Steady\nzGG:µ120 kg\nGewicht:µca. 15.7 kg\nFarbe:µschwarz matt",
                        "TEXT3": "Trekkingrad BBF \"Bilbao Gates\" Damen 8-Gang ND",
                        "TEXT4": "28\", RH 45 cm",
                        "TEXT5": "Maximale Funktionalität - minimaler Wartungsbedarf.\n<<>>\nDas BBF Bilbao Gates glänzt mit dem neuen Gates Carbon Drive. Der Riemenantrieb bietet eine saubere, laufruhige und langlebige Lösung für höchste Ansprüche. Lassen Sie sich vom BBF BIlbao Gates begeistern!",
                        "TEXT6": "",
