                        "TEXT1": "Trekingové BBF \"Bilbao Gates\" dámské 8rychl. nábojové dynamo",
                        "TEXT2": "Rám:µAlu Trapez\nVidlice:µAlu pevná, Urbanstyle\nŘazení:µShimano Nexus 8rychl., volnoběh\nPohon:µGates řemenový \nRáfky:µAlu dvoustěnné X15\nNáboj:µvpředu: Shimano nábojové dynamo, černé\n µvzadu: 8rychl., volnoběh\nPláště:µContinental Speed Ride, černé\n µs reflexem\nBrzdy:µShimano Disc MT201, hydraulické\nOsvětlení:µvpředu: AXA Compactline, 35 Lux\n µvzadu: AXA BlueLine Steady\nCelková zátěž:µ120 kg\nHmotnost:µca. 15.7 kg\nBarva:µčerná matná",
                        "TEXT3": "Trekingové BBF \"Bilbao Gates\" dámské 8rychl. nábojové dynamo",
                        "TEXT4": "28\", výška rámu 45 cm",
                        "TEXT5": "Maximální využití - minimální údržba.\n<<>>\nBBF Bilbao Gates s novým Gates Carbon Drive. Řemenový pohon je čisté, tiché řešení s dlouhou životností pro náročné. Nechte se od BBF Bilbao Gates inspirovat!",
