                        "TEXT1": "Rower trekkingowy BBF \"Bilbao Gates\" męski 8-biegowy dynamo w piaście",
                        "TEXT2": "Rama:µaluminium, męska\nWidelec:µaluminium, sztywny, urbanstyle\nBiegi:µShimano Nexus 8-biegowy, wolnobieg\nNapęd:µpaskowy\nObręcze:µaluminium, wielokomorowe, X15\nPiasty:µprzód: Shimano dynamopiasta, czarna\n µtył: 8-biegowa, wolnobieg\nOgumienie:µContinental Speed Ride, czarne z odblaskiem\nHamulce:µShimano MT201 tarczowe, hydrauliczne\nOświetlenie:µprzód: AXA Compactline, 35 ls\n µtył: AXA BlueLine Steady\nDopuszczalna waga całkowita:µ120 kg\nWaga:µokoło 15,7 kg\nKolor:µczarny mat",
                        "TEXT3": "Rower trekkingowy BBF \"Bilbao Gates\" męski 8-biegowy dynamo w piaście",
                        "TEXT4": "28\", wys. ramy 50 cm",
                        "TEXT5": "Maksymalna funkcjonalność - minimalne wymagania konserwacyjne.\n<<>>\nBBF Bilbao przekonuje szczególnie dzięki nowemu napędowi. Napęd paskowy oferuje czyste, ciche i trwałe rozwiązanie dla najbardziej wymagających. Daj się zainspirować!",
