                        "TEXT1": "Trekingové BBF \"Treviso Pro\" dámské 30rychl. nábojové dynamo",
                        "TEXT2": "Rám:µAlu Trapez\nVidlice:µodpružená Suntour NEX\nŘazení:µShimano Deore XT 30rychl.\nRáfky:µAlu dvoustěnné X6 Disc\nNáboj:µvpředu: Shimano nábojové dynamo, černé\n µvzadu: 30rychl.\nPláště:µSchwalbe Road Cruiser\n µčerné s reflexem\nBrzdy:µShimano Disc MT201, hydraulické\nOsvětlení:µvpředu: AXA Compactline, 35 Lux\n µvzadu: AXA Slim Steady\nCelková zátěž:µ120 kg\nHmotnost:µca. 15.2 kg\nBarva:µtmavě šedá matná",
                        "TEXT3": "Trekingové BBF \"Treviso Pro\" dámské 30rychl. nábojové dynamo",
                        "TEXT4": "28\", výška rámu 45 cm",
                        "TEXT5": "Nejlepší komponenty a prvotřídní design.\n<<>>\nPrecizní řazení s Shimano Deore XT 30rychl. převodem. Bezpečné brzdění s hydraulickými kotoučovými brzdami od Shimano. K plnému vybavení patří nábojové dynamo, stabilní nosič a osvětlení LED.",
