                        "ID_LANGUAGE": 2,
                        "NAME": "TR H BF9/Treviso Pro/Al/FGNDDi/XT-30G/50anthrazit-matt3",
                        "TEXT1": "Trekkingrad BBF \"Treviso Pro\" Herren 30-Gang ND",
                        "TEXT2": "Rahmen:µAlu Herren\nGabel:µFedergabel Suntour NEX\nSchaltung:µShimano Deore XT 30-Gang\nFelgen:µAlu Hohlkammer X6 Disc\nNaben:µvorn: Shimano Nabendynamo, schwarz\n µhinten: 30-Gang\nBereifung:µSchwalbe Road Cruiser\n µschwarz mit Reflex\nBremsen:µShimano Disc MT201, hydraulisch\nBeleuchtung:µvorn: AXA Compactline, 35 Lux\n µhinten: AXA Slim Steady\nzGG:µ120 kg\nGewicht:µca. 15.2 kg\nFarbe:µanthrazit matt",
                        "TEXT3": "Trekkingrad BBF \"Treviso Pro\" Herren 30-Gang ND",
                        "TEXT4": "28\", RH 50 cm",
                        "TEXT5": "Beste Komponenten und erstklassiges Design.\n<<>>\nPrazises Schalten mit der Shimano Deore XT 30-Gang Schaltung. Beim sicheren Bremsen unterstützen Shimanos hydraulische Scheibenbremsen. Zur Vollaustattung gehören Nabendynamo, robuster Gepäckträger und LED-Lichtanlage.",
