                        "TEXT1": "Rower trekkingowy BBF \"Treviso Pro\" męski 30-biegowy dynamo w piaście",
                        "TEXT2": "Rama:µaluminium, męska\nWidelec:µamortyzowany, Suntour NEX\nBiegi:µShimano Deore XT 30-biegowy\nObręcze:µaluminium, wielokomorowe, X6, pod tarcze\nPiasty:µprzód: Shimano dynamopiasta, czarna\n µtył: 30-biegowa\nOgumienie:µSchwalbe Road Cruiser\n µczarne z odblaskiem\nHamulce:µShimano MT201 tarczowe, hydrauliczne\nOświetlenie:µprzód: AXA Compactline, 35 ls\n µtył: AXA Slim Steady\nDopuszczalna waga całkowita:µ120 kg\nWaga:µokoło 15,2 kg\nKolor:µciemnoszary mat",
                        "TEXT3": "Rower trekkingowy BBF \"Treviso Pro\" męski 30-biegowy dynamo w piaście",
                        "TEXT4": "28\", wys. ramy 50 cm",
                        "TEXT5": "Najlepsze komponenty i pierwszorzędny design.\n<<>>\nPrecyzyjna zmiana biegów dzięki 30-biegowej przekładni Shimano Deore XT. Hydrauliczne hamulce tarczowe Shimano zapewniają bezpieczne hamowanie. Pełnego wyposażenia dopełniają: dynamo w piaście, solidny bagażnik i system oświetlenia LED.",
