                        "TEXT5": "Nejlepší komponenty a prvotřídní design.\n<<>>\nPrecizní řazení s Deore XT 30rychl. řazením od Shimano. Bezpečné brzdění s hydraulickými kotoučovými brzdami od Shimano. K úplnému vybavení patří nábojvé dynamo, stabilní nosič a osvětlení LED.",
